import React from "react";
import "./App.css";
import { Routes, Route } from "react-router-dom";
import classes from "./App.module.css";
import HomePage from "./pages/HomePage/HomePage";
import SetPage from "./pages/SetPage/SetPage";
import MethodPage from "./pages/MethodPage/MethodPage";
import Sidebar from "./components/Sidebar/Sidebar"; // Import Sidebar
import { SidebarProvider } from "./contexts/SidebarContext";
import { NavbarProvider } from "./contexts/NavContext";

function App() {
    return (
        <NavbarProvider>
            <SidebarProvider>
                <div className={classes.app}>
                    <div className={classes.content}>
                        <Routes>
                            <Route path="/" element={<HomePage />} />

                            <Route path="/1st" element={<SetPage pc={1} />} />
                            <Route path="/2nd" element={<SetPage pc={2} />} />
                            <Route path="/3rd" element={<SetPage pc={3} />} />
                            <Route path="/4th" element={<SetPage pc={4} />} />
                            <Route path="/5th" element={<SetPage pc={5} />} />
                            <Route path="/6th" element={<SetPage pc={6} />} />
                            <Route path="/7th" element={<SetPage pc={7} />} />

                            <Route path="/1st/:methodId" element={<MethodPage />} />
                            <Route path="/2nd/:methodId" element={<MethodPage />} />
                            <Route path="/3rd/:methodId" element={<MethodPage />} />
                            <Route path="/4th/:methodId" element={<MethodPage />} />
                            <Route path="/5th/:methodId" element={<MethodPage />} />
                            <Route path="/6th/:methodId" element={<MethodPage />} />
                            <Route path="/7th/:methodId" element={<MethodPage />} />
                        </Routes>
                    </div>

                    <div className={classes.sidebar}>
                        <Sidebar />
                    </div>

                    <div className={classes.navbar}>
                        <Navbar />
                    </div>
                </div>
            </SidebarProvider>
        </NavbarProvider>
    );
}

export default App;
